class Solution:
    def maximumGain(self, s: str, x: int, y: int) -> int:
        # Use a stack - more efficient algorithm.
        # Stacks are highly efficient for this problem. The append and pop
        # operations on stack are both of O(1) complexity.
        # The algorithm that performs string rebuilding inside a while loop
        # is highly inefficient as string rebuilding is an expensive operation.
        if x >= y:
            check1, check2 = 'ab', 'ba'
        else:
            check1, check2 = 'ba', 'ab'
        hsh = {'ab': x, 'ba': y}
        res = 0
        stack = list()
        for ch in s:
            if stack and stack[-1] + ch == check1:
                res += hsh[check1]
                stack.pop()
            else:
                stack.append(ch)
        s1 = ''.join(stack)
        stack = list()
        for ch in s1:
            if stack and stack[-1] + ch == check2:
                res += hsh[check2]
                stack.pop()
            else:
                stack.append(ch)
        return res

# Main section
for s, x, y in [
                  ('cdbcbbaaabab', 4, 5),
                  ('aabbaaxybbaabb', 5, 4),
                  ('', 4160, 8507),
               ]:
    print(f's = {s}')
    print(f'x, y = {x}, {y}')
    sol = Solution()
    r = sol.maximumGain(s, x, y)
    print(f'r = {r}')
    print('============================')





